import Sidebar from './components/sidebar';
import React, { useState } from 'react';
import ReactMarkdown from 'react-markdown';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCopy } from '@fortawesome/free-solid-svg-icons';


function ChatUI() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');

  const sendMessage = async () => {
    if (input.trim() !== '') {
      const userMessage = { text: input, sender: 'User' };
      setMessages((prev) => [...prev, userMessage]);
      setInput('');

      // Simulate an API call (replace with your backend call)
      const response = await fetch('http://127.0.0.1:5000/chat', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ message: input }),
      });

      const data = await response.json();
      const assistantMessage = { text: data.response, sender: 'Assistant' };
      setMessages((prev) => [...prev, assistantMessage]);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      sendMessage();
    }
  };
  const copyToClipboard = (text) => {
    navigator.clipboard.writeText(text);
    alert("Copied to clipboard!");
  };

  return (
    <div style={styles.container}>
      <Sidebar /> 

      <div style={styles.chatContainer}>
        <div style={styles.chatWindow}>
          {messages.map((msg, index) => (
            <div key={index} style={styles.messageContainer}>
              {msg.sender === 'User' ? (
                <div style={styles.userChat}>
                  <img src="/man.png" alt="User" style={styles.avatar} />
                  <div style={{ ...styles.message, ...styles.userMessage }}>
                    {msg.text}
                  </div>
                </div>
              ) : (
                <div style={styles.assistantChat}>
                  <img src="/ai-technology.png" alt="Assistant" style={styles.avatar} />
                  <div style={{ ...styles.message, ...styles.assistantMessage }}>
                    <ReactMarkdown>{msg.text}</ReactMarkdown>
                  </div>
                </div>
              )}
            </div>
          ))}
        </div>
        <div style={styles.inputContainer}>
          <input
            type="text"
            value={input}
            onChange={(e) => setInput(e.target.value)}
            onKeyPress={handleKeyPress}
            style={styles.input}
            placeholder="Type a message..."
          />
          <button onClick={sendMessage} style={styles.sendButton}>
            Send
          </button>
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    height: '100vh',
  },
  chatContainer: {
    display: 'flex',
    flexDirection: 'column',
    height: '95vh',
    justifyContent: 'flex-end',
    backgroundColor: '#f1f1f1',
    padding: '20px',
    flex: 1, // Adjust based on sidebar
  },
  chatWindow: {
    flex: 1,
    overflowY: 'auto',
    padding: '10px',
    backgroundColor: '#fff',
    border: '1px solid #ccc',
    display: 'flex',
    flexDirection: 'column',
  },
  messageContainer: {
    display: 'flex',
    alignItems: 'flex-start',
    marginBottom: '10px',
  },
  userChat: {
    display: 'flex',
    alignItems: 'center',
    marginLeft: 'auto',
    flexDirection: 'row-reverse',
  },
  assistantChat: {
    display: 'flex',
    alignItems: 'center',
  },
  avatar: {
    width: '40px',
    height: '40px',
    borderRadius: '50%',
    marginRight: '10px',
  },
  message: {
    margin: '10px 0',
    padding: '10px',
    borderRadius: '20px',
    maxWidth: '60%',
    display: 'inline-block',
    wordWrap: 'break-word',
    whiteSpace: 'pre-wrap',
  },
  userMessage: {
    backgroundColor: '#007bff',
    color: '#fff',
    marginLeft: 'auto',
    textAlign: 'right',
    width: 'fit-content',
  },
  assistantMessage: {
    backgroundColor: '#e1e1e1',
    color: '#000',
    marginRight: 'auto',
    textAlign: 'left',
    width: 'fit-content',
  },
  inputContainer: {
    display: 'flex',
    borderTop: '1px solid #ccc',
    padding: '10px',
    backgroundColor: '#fff',
  },
  input: {
    flex: 1,
    padding: '10px',
    borderRadius: '5px',
    border: '1px solid #ccc',
    marginRight: '10px',
  },
  sendButton: {
    padding: '10px 20px',
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

export default ChatUI;
